@EU_Commission You are going on my block list definitely. 
Every day same , exactly the same thing , we make sure vaccine are this , vaccine are that . 
And what did you do until today? Nothing lockdowns are again in force will enter 2021 like that and maybe half of 2021 after what?

@EU_Commission No, it's not.
The best way to end Covid-19 is containment.
Vaccines will work but it will take many months before the whole population can benefit from them. We need to contain this virus first. It will save thousands of lives and also make eventual vaccination easier.

