Credibilitat UE=0

@EU_Commission Get rid of the abusive #roaming platforms, which add no value to the enduser and double the price of public charging.
You did it with #Banking and #telecommunications.
We have no time.

@EU_Commission @Transport_EU @TimmermansEU @AdinaValean Where is the role of the bike in these aims? At least in urbanised areas.
The (electric) bike often can be the gamechanger.
With much less energy, materials requirements and far lower emissions, and beneficial for government spending on roads and infra and good for human health!
